import React from "react";
import { useAuth } from "../hooks/useAuth";
import { Route, Redirect } from "react-router-dom";

export const PrivateRoute = ({ children, ...rest }) => {
    const { user } = useAuth();

    return (
        <Route
            {...rest}
            render={() => (user == null ? children : <Redirect to="/login" />)}
        ></Route>
    );
};
